import React from 'react'
import NavBar from '../Navbar'
import './CodeEditor.css'
import CoursesScrollBar from './CoursesScrollBar'

const CodeEditor = () => {
  return (
    <div className='codeEditormainDiv'>
        {/* <NavBar/> */}
        {/* <CoursesScrollBar/> */}
        <div className="codePenDiv">
             <p>Codepen embed:</p>
    <p data-height="265" data-theme-id="0" data-slug-hash="vGNKNj" data-default-tab="css,result" data-user="blonfu" data-embed-version="2" class="codepen">See the Pen <a href="http://codepen.io/blonfu/pen/vGNKNj/">Modificar color de texto seg√∫n fondo (stylus)</a> by blonfu (<a href="http://codepen.io/blonfu">@blonfu</a>) on <a href="http://codepen.io">CodePen</a>.</p>
    <script async src="//assets.codepen.io/assets/embed/ei.js"></script>
        </div>
    </div>
  )
}

export default CodeEditor
